- thewaymouth at [thepiratebay] 2013-10-12 02:13 CET :

Up on the Billboard Hot 100 right now, Summertime Sadness is hanging on well into October. US govt shut-down be damned, Lana Del Rey of sunshine is sizzlling like a snare at #10 again this week... So here I go with that Summertime Sadness Remixed with this falling off a cliff, a bridge too far across the waiting Wintertime Madness... Be that as it May will come again, I just wanted you to know that baby you the best.


- Forward into the 2014 MTV VMA's : Lana is not scheduled to appear (not again!), but at least she got a nomination (just one, huh?) : Best Cinematography - West Coast.

I hereby now declare Lana Del Rey to be victor in the 2014 MTV VMA's! 

The West Coast is the best most (and Shades of Cool not fades away but stays to rule the blue gene pool). 


- 2014-08-16 @ The Pirate Bay around thewaymouth

The dog daze of summer are all but over now for this fish out of clear water born in the year of the diamond dog. 

And so I got this summertime sadness again. The best time of year is here and over there before you know it.

&quot;Summertime's done come and gone, my oh my&quot;

Well almost, so it's time to make the the most of what's left with who the hell else but... 

The Belle of Bel Air : That Sound &amp; Vision Pop Goddess Artist at the Head of the Heart :

&quot;My baby, you the best...&quot; on you we rest and forget about the rest.

Lana Del Rio 

De Monte-Cristo 

- THE REDREAMER - 

Summertime Genius.

